import React from 'react';

function About() {
  return (
    <section class="about" id="about">
    <div class="container flex-center" id="about-container">
        <h2 class="section-title" id="about-title">About Me</h2>
        <div class="con">
            <div class="text-container">
                <h3>I'm a <span>front-end developer</span> based in <span>Helsinki</span> willing to be a Full stack Developer in future. I am currently a student at Stadin AO, pursuing studies in IT. Simultaneously, I am a self-taught front-end developer through Udemy, aiming to enhance my skills for future endeavors in front-end development</h3>
            </div>
        </div>
    </div>
</section>
  );
}

export default About;
